export default (state, action) => {

  switch (action.type) {
    case "WITHDRAW_10000":
      return { ...state, balance: action }
    case "WITHDRAW_5000":
      return { ...state, balance: action }
    case "GIVE_ALL_TO_CHARITY":
      return { ...state, balance: action }
    default:
      return state;
  }

}
